import React, { useState } from "react";

export default function Login(){
    return (
      <form>
        <input
          type="text"
          placeholder="Username"
        />
        <input
          type="password"
          placeholder="Password"
        />
        <button>Sign Up / Login</button>
      </form>
    );
}
